import React from 'react';
import styled from "styled-components";
import {RowContainer} from "../components/header/header";
import Text from "../theme/text";
import Button from "../theme/button";
import Image from "../theme/image";
import Gun from "../components/page-components/bag/images/gun.png"

const ModRowContainer = styled(RowContainer)`
  justify-content: space-between;
`;

const Bag = () => {
    return (
        <>
            <div style={{
                backgroundColor: "#DDDDDD", padding: "8px 100px 10px 15px", marginBottom: "25px", marginTop: "20px", borderRadius: "0 0 10px 10px", width: "fit-content"
            }}>
                <Text fontSize={"20px"} color={"black"}>
                    Negevs
                </Text>
            </div>
            <div style={{backgroundColor: "#DDDDDD", padding: "20px", marginBottom: "25px", borderRadius: "10px"}}>
                <ModRowContainer>
                    <RowContainer>
                        <div style={{backgroundColor: "#320F0F", }}>
                            <Image src={Gun}/>
                        </div>
                        <div>
                            <div>
                                <Text color={"white"} fontSize={"16px"}>
                                    Negev | dev_texture
                                </Text>
                            </div>
                            <div>
                                <Text color={"white"} fontSize={"16px"}>
                                    Negev | dev_texture
                                </Text>
                            </div>
                            <div>
                                <Text color={"white"} fontSize={"16px"}>
                                    Negev | dev_texture
                                </Text>
                            </div>
                        </div>
                    </RowContainer>
                </ModRowContainer>
            </div>
        </>
    )
}

export default Bag;
